export const Logo: React.FC<Props> = ({ variant, ...props }) => {
    const navigate = useNavigate()

    const logoProps = {
        ...props,
        onClick: () => {
            navigate('/', {})
        },
        className: 'tiszta-logo',
    }

    if (variant === 'sm') return <LogoSmall {...logoProps} />
    return <LogoLarge {...logoProps} />
}

Logo.defaultProps = {
    fill: theme.colors.BuddhaGold,
    variant: 'lg',
    scaleOnHover: false,
    width: '100%',
    height: '100%',
    xmlns: 'http://www.w3.org/2000/svg',
}
